import Card from 'react-bootstrap/Card';
import { useOutletContext } from 'react-router-dom';

function InstagramCard ({ instagram }) {
    console.log(instagram)
    // const {name, account, link, followers, description} = instagram;

    const [data] = useOutletContext();

    const itemArray = data.map((item, index)=> {
        const eachInstaCard = item.instagram.map((instagram, index)=> {
            const {name, account, link, followers, description} = instagram;

            return (

                <Card style={{ width: '18rem' }}>
                <Card.Body>
                    <Card.Title>{name} </Card.Title>
                    <Card.Text>{followers}</Card.Text>
                    <Card.Text>{description}</Card.Text>
                    <Card.Link href={link}>{account}</Card.Link>
                </Card.Body>
            </Card>

            //    <InstagramCard key={index} instagram={instagram} />
            )
        })
        return (
            <div key={index}>
                {eachInstaCard}
            </div>
        )
    })


    return (
            <Card style={{ width: '18rem' }}>
                <Card.Body>
                    <Card.Title>{name} </Card.Title>
                    <Card.Text>{followers}</Card.Text>
                    <Card.Text>{description}</Card.Text>
                    <Card.Link href={link}>{account}</Card.Link>
                </Card.Body>
            </Card>
    )
}

export default InstagramCard
